import React from "react";
import { View } from "react-native";
import { ThemeProvider, Button, Text } from "react-native-elements";


function Landing() {
  return (
    <View>
        <Button title="My Button" />
        <Button title="My 2nd Button" />
        <Text></Text>
    </View>
  );
}

export default Landing;
